import React , { Component }  from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);

  }

  render() {
    return (
      <div className="App">
        <h1>
          Hello How are you?
        </h1>
         <button>
          Run Timer
        </button>
        <br></br>
        <br></br>

        Show Elapsed Time<input type="checkbox" />
      </div>
    );
  }
}


export default App;
